import React from 'react';
import {
    Container,
    Row,
    Col,
  } from 'react-bootstrap';
const Explore=()=>{
    return(
        <Container fluid="md">
        <Col>
        <Row sm={3}>sm=3</Row>
        <Row sm={3}>sm=3</Row>
        <Col sm={6}>sm=6</Col>
        </Col>
      </Container>
    )
}

export default Explore;
